import React from "react";

export default function List({
  user,
  onClickIsDoneHandler,
  onClickDeleteHandler,
}) {
  console.log("user", user);
  return (
    <>
      <div>
        <h6>{user.title}</h6>
        <p>{user.cont}</p>
        <button onClick={(e) => onClickDeleteHandler(e.id)}>삭제하기</button>
        <button onClick={onClickIsDoneHandler}>완료하기</button>
      </div>
    </>
  );
}
